        "description": "Small Royal Doulton jug - creamer or whiskey water jug.\nThe design is pattern no. x2892 made from 1881 - A huntsman with his hunting horn and dogs gallops round the bottom of the jug, towards a windmill, in pursuit of a stag. At the top two men sit in the tavern, one with a clay pipe the other, at the other side of the jug, sitting with a jug of ale. All scenes from rural life of the Victorian period. \nThe mark , as photographed, shows that the jug was made between 1902 and 1922 - This mark was in general use at Burslem between 1902 and 1922. It was introduced in the latter part of 1901 to mark the grant of the Royal Warrant by King Edward VII together with the specific right to use the word ROYAL to designate Doulton products.\nA little bit of the history of Doulton prior to that:\n By 1877 Henry Doulton had established the name of the Doulton Lambeth art wares and set up factories making sanitary, industrial and architectural products in Rowley Regis, St. Helens and Smethwick. He decided to accept an invitation to invest money in Pinder, Bourne & Co., Burslem, a medium-quality earthenware factory. Within ten years he had enlarged the factory three times, built a china works, taken on the largest and most gifted group of artists in the Potteries, and developed for Doulton a reputation for craftsmanship and artistry still identified with Royal Doulton today.\nJug diam. at widest: 3 7/8 ins.\nLength: 4 1/2 ins. across spout and handle\nHt.: 5 7/8 ins.",
