            "title": "We Can Design For Any Ideas You May Have in Mind! ",
            "announcement": "Personalized Gifts for Any Occasion! We can design for any ideas you have in mind.\r\n\r\nWhen shopping at Design&#39;s the Limit you may choose from any of our designs when you select a product, or send us your custom requests and we will design for you! Theme weddings, special interests, and wild ideas are all welcome here. We enjoy a challenge and appreciate the unique inspiration of all of our customer&#39;s dreams! Give a gift that will be treasured and put to good use and make every gift you give a personal experience.\r\n\r\nCHARITABLE DONATION MATCHING LISTING: \r\nhttps://www.etsy.com/listing/182194723/donation-match\r\nTogether we can make a difference!\r\n\r\nAs a member of the Etsy Giving Team, Design&#39;s the Limit would like to encourage all of our customers to make a charitable contribution with every order. Every dollar donated will go to a charitable cause, the Etsy seller fees for the transaction will be paid by Design&#39;s the Limit, and we will make a donation with you! Design&#39;s the Limit and You can make a difference together!\r\n\r\nDesign&#39;s the Limit is our dream of expressing our artistic desires, making unique and creative designs for every special occasion, creating personal gifts that our customers will appreciate for years to come, and enjoying what life sends our way! Design&#39;s the Limit offers design and personalization of custom glass, stone, wood, and other materials from personalized gifts to display artwork. Give us an inspiration and we will design for any idea you have in mind. Personalized gifts are perfect for any gift giving occasion to show your gift recipient that they are worth the time to design the perfect gift with them in mind. \r\n\r\nDesign&#39;s the Limit encourages all of our customers to submit a custom order request so that we can make your gift purchase personal. Please let us know what item(s) you are interested in and your zip code and we will create a private listing for you! We will include a discount on all purchases for multiple items, for any order over a certain dollar amount, and we may be able to reduce the shipping charges. Think outside the box and inspire our creativity with your design requests or choose any combination of our design options and fonts from our selection. \r\n\r\nFrom Richard and Tatiana ETSY SHOP / Design&#39;s the Limit\r\ninfo@designsthelimit.com     E-mail pictures or logos to us for custom orders!\r\nwww.designsthelimit.etsy.com     Personalized gifts for every occasion!\r\nwww.facebook.com/designsthelimit     Like us and Share!\r\nwww.twitter.com/designsthelimit     Follow us!\r\nwww.pinterest.com/designsthelimit Follow us!\r\n\r\nENCOURAGE RESPONSIBLE ENJOYMENT IN YOUR COMMUNITY!\r\nThe enjoyment of beer and distilled spirits, treated responsibly for enjoyment and celebration, have become as American as any pie. Design&#39;s the Limit would like to ask all of our customers to encourage responsible enjoyment and don&#39;t be that guy. Don&#39;t Drink and Drive, give up the keys and stay alive.  \r\n\r\nAll visitors to our shop are subject to the terms and conditions of Design&#39;s the Limits shop policies without exception. It is the customers responsibility to read and understand our shop policies when visiting our store. Please contact us by clicking, &quot;Ask a Question,&quot; &quot;Request a Custom Order,&quot; or &quot;Contact Shop Owner,&quot;  if you have any questions at all. We specialize in personalized gifts for any occasion and for every interest, whether you wish to choose from what you see or submit any idea you can imagine. Excellent customer service is our goal with every customer and every order.",
