        "description": "Any man on your gift list will love this bag! It is classic, sophisticated, practical, handmade, and best of all, you can personalize it especially for him with up to 4 initials added for free. \n\nThis spacious bag is constructed of soft, top grain leather in our best-selling Whiskey-Carmel leather. The leather has a semi-aniline finish with a waxy hand to provide a beautiful look and added years of protection against wear and soiling. This toiletry bag is also fully lined in a water resistant nylon, which makes it easy to clean with a damp cloth. All seams are enclosed. \n\nWe use a heavy duty YKK brass zipper closure and leather zipper pull. The wide zipper opening allows easy access to contents. Tabs on both ends make the bag easy to zip open and closed.\n\nEach bag is hand cut and custom embroidered before it is lined and stitched together with strong nylon thread on an industrial sewing machine. Every step is executed carefully so you will have a sturdy, well-constructed bag that will hold up to years of use.\n\nMeasures approximately: 8.5&quot; wide, 3.5&quot; tall, 4&quot; deep. \n\nThis toiletry bag is large enough to hold the essentials a guy might need. \n\nIf you want initials embroidered on the bag, please specify in &quot;comments to seller&quot; when you place your order. We&#39;re happy to make this bag personal! If you would like to order multiples, please select quantity, and let us know in the comments to seller how to initial each dopp kit. \n\nOPTIONAL UPGRADE:\nFor an additional $15, you can include a message up to 30 characters on the inside of the bag, in either block lettering or script lettering. \n\nBecause this is a hand-crafted product, every bag will be slightly different in terms of its color and texture, but comes with a guarantee of solid, consistent construction. Don&#39;t be fooled by other sellers who embroider commercially-made bags and then label them hand-made. Here at Felix Street Studio, we source our leather hides locally, cut all of our own leather, and produce all of our products from scratch. You can be sure that if you purchase from Felix Street, you are getting a quality product made from American materials by one of our talented in-house artisans. \n\nHappy with the design, but wish it was a little bigger? A larger size is also available! Please see this listing: https://www.etsy.com/listing/167268622/personalized-gift-for-man-larger-leather",
