            "is_vacation": false,
            "vacation_message": null,
            "sale_message": "Thank you for your purchase. We hope you enjoy it as much as we enjoyed making it!\r\n\r\nIf the item you receive is not what you expected, please convo, and we will work things out.  We want your shopping experience  to be fabulous, and will jump through hoops to make that happen.\r\n\r\nThanks again,\r\nKathy",
            "digital_sale_message": null,
            "last_updated_tsz": 1432148414.99,
            "listing_active_count": 209,
            "login_name": "FelixStreetStudio",
            "accepts_custom_requests": true,
            "policy_welcome": "Welcome to Felix Street Studio!  We love what we do and appreciate the good karma involved in selling to people who love what we make.  Our goal is to make every transaction a fabulous experience, from initial order, to packaging, to your pleasure in using my handcrafted items.  Please contact me if you have any questions at all.  \r\n\r\nWe are frequently approached about offering discounts, or selling  to retailers at wholesale prices.  Our Etsy prices reflect a fair compensation for our time, talent, and materials. We do not inflate my prices so that we can offer &quot;discounts&quot;.  Etsy provides a venue where we don&#39;t have to pay for additional middle-woman or distribution costs, and we prefer to pass that value on to our one-on-one customers.  So, please know that you are getting our very best pricing and although we are flattered by the requests, we do not offer wholesale pricing to re-sellers. ",
            "policy_payment": "We accept credit cards through Etsy&#39;s processing system OR PayPal.  \r\n\r\nIf you request a custom listing, please complete the order/payment process within 24 hours.  If you do not order or contact us within that time we will assume you have made other arrangements and will delete your custom listing.\r\n\r\nWe collect and report sales taxes on all sales within Arizona.",
            "policy_shipping": "SHIPPING INFO:\r\nWe carefully select the most cost-effective packaging and keep it as light-weight as possible.  \r\n\r\nUpon purchasing an item from FELIX STREET, you will receive a confirmation from us with a promised shipping date. Shipping commitments are serious business here, and we keep our promises.  Please double-check the ship-to address before you order.  Obviously,we cannot honor delivery commitments if your provide the wrong address.\r\n\r\nPlease remember that handcrafted personalized goods are made after they are ordered. We are proud of our turn around times and we are fast.  But if you need your order by &quot;Friday&quot; please let us know so we can upgrade your order to RUSH/Priority status and charge you accordingly.\r\n\r\nAfter shipping thousands of packages, we have great confidence in the United States Postal Service.  However, sometimes a package is marked as delivered but does not make it into the buyer&#39;s possession - particularly when delivered to apartments.  When the US postal service tells us they have delivered the package to a correctly addressed location, we must assume theft.  Therefore, we do not issue refunds or replacements on orders identified by USPS as delivered.  \r\n\r\nInternational Customers:\r\n\r\nUSPS First class INTERNATIONAL mail is not insured through the United States Postal Service (USPS). Items shipped via First Class International Mail will not be insured if your item is lost in the mail. It cannot be traced or tracked.  Under these conditions we cannot offer refund or replacement.  By purchasing the items, you accept these terms. Estimated Delivery Time averages 15 business days from date shipped.\r\n\r\nWe will gladly ship to most countries.  However, we cannot  track your shipment or guarantee delivery.  Unfortunately, international packages do sometimes go astray once they leave the U.S.  \r\n\r\nImport duties, taxes, and charges are not included in the item price or shipping cost. These charges are the buyer&#39;s responsibility. Please check with your country&#39;s customs office to determine what these additional costs will be prior to buying. \r\n\r\nWe will gladly ship to most countries.  However, we cannot  track your shipment or guarantee delivery.  Unfortunately, international packages do sometimes go astray once they leave the U.S.  \r\n",
            "policy_refunds": "Again, we want you to be happy with your purchase from Felix Street.  We will jump through hoops to make that happen.  Let us know if you have any issues with our products and we will work with you to make it right.\r\n\r\nOrders cannot be returned or refunded unless the item is not as described in the listing or we have made a mistake.  In this rare event, your order will be promptly replaced.  Please read through my feedback to review the thousands of positive experiences with previous customers who left ratings.",
            "policy_additional": "INTERNATIONAL SHIPMENTS - (UK CUSTOMERS ESPECIALLY - PLEASE READ);\r\n\r\nBuyers are responsible for any in-bound duties/VAT/customs fees charged by their country.\r\n\r\nInternational customers are responsible for all import taxes, customs duties and fees levied by the destination country. These fees and taxes and any additional charges for customs clearance are levied once a shipment reaches your country, and must be borne by the recipient. I have no control over these charges and cannot predict what they may be. Customs policies vary widely from country to country; you should contact your local customs office for further information. Please be aware that when customs clearance procedures are required, it can cause delays beyond my original delivery estimates. All international orders will have full value declared on customs forms, and will be marked as &quot;merchandise&quot; - no exceptions.",
