        "title": "Set of 6 Groomsman / Bridesmaid & Best Man Whiskey Style Labels - Be My Groomsman - OR Groomsman Gift - Wedding Party",
        "description": "Custom labels to ask OR Thank your wedding party in this unique way! \n\n3 Label sizes available:\n200 ML (as shown in main photo) - Includes 9 (NINE) labels 3&quot; x 2&quot;\n375 ML SQUARE bottle (not flask shape) - Includes 6 (SIX) labels 3.25&quot; x 4&quot;\n750ML bottle - Includes 6 (SIX) labels 4&quot; x 3.25&quot;\n\n3 Label purposes available:\nBe My Groomsman/Best Man?\nThank you for being my Groomsman/Best Man\nTitle Only (such as &quot;Groomsman&quot; &quot;Best Man&quot; or &quot;Usher&quot;)\n\n****In NOTES TO SELLER at checkout PLEASE LEAVE ME A MESSAGE WITH THE FOLLOWING****\n\n1. BEST MAN NAME(S) *for best look I suggest FIRST NAMES only for longer names*\n2. GROOMSMEN NAME(S)\n3. Your married LAST NAME\n4. Wedding DATE/or season/year if not yet determined\n5. Wedding LOCATION (city, state or country)\n6. FIRST INITIALS of Bride and Groom (in the order you prefer on label)\n7.* FIRST NAME of Groom (for Groom label if extra available)\n\nThis label reads:\nNAME\nFIRST INITIALS OF BRIDE AND GROOM\nBE MY Groomsman/Best Man?\nCHEERS TO THE\nTHE (LAST NAME) WEDDING PARTY\nLOCATION OF MARRIAGE\nWEDDING DATE (Reads MM.DD.YYY) *periods in between\n\n***********QUANTITY HELP***********\nLabels are printed 6 or 9 to a sheet and the price is the same for 6/9 or less. Purchase additional labels for $4 each here: https://www.etsy.com/listing/125412555/custom-additional-labels-reserved-for\n\n**************SHIPPING****************\nUS Standard delivery is typically 6-8 business days to your door from placing order. RUSH is typically 3-4 business days to your door. USPS does experience rerouting and delays from time to time. EXPRESS is typically overnight or 2nd day service (varies on location) and is the only guaranteed shipping option. A tracking number will be sent upon shipment and details regarding your shipping date can be viewed on your &quot;Purchases&quot; page. For additional shipping information , including international shipping times, please see Shipping section on shop Policies Page. Standard International delivery is typically 2-3 weeks.\n\n*****NEED YOUR ORDER RUSHED?!*****\nPurchase expedited printing and shipping from the drop down at check out!\n\n- Labels only--no whiskey included :)\n- Label removal and handling instructions are sent with your order.\n- This label can be customized for the ladies as well!  Just please note your order!\n\nEach label includes personalization with name, location, date, and your new last name/or first name. Each line can be customized as requested based on fitting. Please allow 24 hours for additional customization.\n\nLabels are printed on semi-gloss self-adhesive sheet and cut to size 3&quot; x 2&quot; OR 4&quot; x 3.25&quot; (letter size sheet).   For best results, handle minimally and avoid moisture.  Abbreviations are made where necessary.\n\nWhiskey and bottle is not included. :)\n\nA gift soon not forgotten! Happy Wedding Planning!",
