            "currency_code": "USD",
            "is_vacation": false,
            "vacation_message": "Merry Christmas!  We are on a long-awaited holiday vacation and spending some QT with friends and family!!  Although my husband might put up a fight, I would have brought my 1,265 lb printer with me if I could.  Lucky for him, it wouldn&#39;t fit in the trunk ;). So... We are forced to enjoy the holidays sans work.  \r\n\r\nWe will be back December 30th and begin furiously working on your orders.  If you are in a time crunch, please note this on your order at checkout and we&#39;ll do our best to get your fabulous labels to you on time.\r\n\r\nWishing everyone a Merry Christmas and a safe holiday season!\r\n\r\nHappy Everything!\r\n\r\nRachel",
            "sale_message": "Thank you so much for your purchase! Please like us on facebook to keep up with what&#39;s new and specials! We also would love the see the fun photos, laughs, tears, and moments capturing your unique wine labels! \r\n\r\n https://www.facebook.com/studioblabels\r\n\r\n ENTER OUR PHOTO CONTEST and win by submitting your best moments with your bottles and crew! Get creative and show those babies off!\r\n\r\n See our facebook page or message me for contest rules. Winners chosen monthly and receive a gift certificate!",
            "digital_sale_message": "Thank you for your order!  These are set up to printed on a standard letter sized sheet and each label should be cut to approximately 4&quot; x 3.25&quot;. \r\n\r\nTypically you can use a full shipping label and have it printed on any commercial printer. For instance Office Depot, etc all can print for $0.70 per copy and can even cut it for you!  Or you can send the file to a printer and they will print on cut on their professional machines.   \r\n\r\nIf you are printing labels instead of tags I do not suggest purchasing pre-cut (Avery for instance) labels and attempting to line up the file to their layout.  It is definitely easiest to print the file on a full sheet and cut to your dimensions!\r\n\r\nHope they are a hit!\r\nRachel",
            "last_updated_tsz": 1432149005.79,
            "listing_active_count": 67,
            "login_name": "RDMULLET",
            "accepts_custom_requests": false,
            "policy_welcome": "Thank you for visiting my shop!  Feel free to look around at the many designs I have.  Stay tuned...more designs for all occasions coming soon!",
            "policy_payment": null,
            "policy_shipping": "Standard orders in the US ship in 3 business days and are typically 3-5 business days once shipped (or 6-8 business days to your door from the time of placing your order.) \r\n\r\nI also offer 3 expedited services you can choose at check out. \r\n\r\n1)  PRIORITY SHIPPING $4.50 upgrade-  Typically 5-6 business days to your door.\r\n2)  RUSH $12.00 upgrade - Ships next business day PRIORITY  Typically 3-4 business days to your door from placing order.  Insurance included.\r\n3)  EXPRESS $26.45 upgrade - Next day (or same day if possible) turnaround and EXPRESS shipping (typically 1-2 day service).  1-3 days to your door from placing order.  Insurance Included.\r\n\r\nPlease keep in mind RUSH EXPRESS is the only shipping option guaranteed by USPS!  You can purchase any of these shipping upgrades at check-out under &quot;Shipping&quot; if needed.\r\n\r\nUSPS and I have a love/hate relationship.  I love their prices (and so do you) but I hate it when they don&#39;t deliver on time.  Ug.  Which takes me to my next point--\r\nUSPS DOES NOT GUARANTEE ANY SHIPPING TIMES WITH THE EXCEPTION OF EXPRESS.  Sad but true.  Express in most cases, is overnight delivery and is a flat rate of $21.45 to US residents.  For those of you willing to fork it over, please message me for Express delivery option.  Keep in mind if you need 2 day turnaround to your door--you&#39;d need to purchase the RUSH option as well.  This bumps you to the front of every line.\r\n\r\nUSPS recognizes M-F as considered &quot;Postal Business Days&quot;.  Please keep this in mind when doing the math on when to expect your order!\r\n\r\nSo in a nutshell:\r\n\r\nStandard Shipping (6-8 business days to your door)\r\nRUSH Shipping (3-4 business days to your door)\r\nEXPRESS Shipping (2 business days to your door excluding extreme rural areas which is 3 business days) USPS guarantees this method or your shipping money back.\r\n\r\nI have had very few issues with the USPS however it does happen.  Typically 5 out of every 100.  I take a lot of pride in my labels as they are all edited one at a time--Trust me when I say I would hand deliver them if I could! :)\r\n\r\nINTERNATIONAL SHIPPING:\r\nInternational shipping is typically 2-3 weeks depending on its destination and how long it takes to process through customs (which always varies.)  USPS does not guarantee these shipping times and from time-to-time there are significant delays in Customs.  USPS does offer guaranteed services (which are super expensive but again, guaranteed.)  Please message me directly if you are interested in International guaranteed USPS delivery. \r\n\r\n7-11 Day RUSH International Ship (Business Days) \t$30.50 USD\r\n9-14 Day International Shipping (Business Days) \t$25.50 USDD\r\n4-6 Day RUSH International Shipping \t$45.75 USD\r\n\r\n***PLEASE NOTE from time to time International buyers are forced to pay customs fees and/or taxes that are levied on many packages being imported into some countries.  Because sellers are unable to predict what fees, if any, certain countries will apply, Etsy does not hold sellers responsible for unexpected customs fees or taxes.  In my experience I have only seen this through Royal Mail.  Just a heads up!",
            "policy_refunds": "No refunds offered once the design process has begun.  There is nothing I want more than a happy customer.  I&#39;ll do everything I can to make sure that happens!--Scouts honor.",
            "policy_additional": "It is important to include all requested info needed to complete your order.  Missing information will likely delay your order shipment.  Design changes or capitalization requests must be stated separately at check out.  Abbreviations are made where necessary. \r\n\r\nProofs are available at no charge based on request!  Please note a &quot;PROOF REQUEST&quot; on your order at check out if interested!  Proofs must be approved within 14 days or will be shipped as-is.\r\n\r\nPlease also note that some designs have all lowercase font (disregarding proper noun capitalization) per their design -- although this is intended and recommended it can be changed if stated in a separate sentence as a &quot;request for proper noun capitalization&quot;",
            "policy_seller_info": null,
            "policy_updated_tsz": 1428151257,
            "vacation_autoreply": "Merry Christmas!  We are on a long-awaited holiday vacation and spending some QT with friends and family!!  Although my husband might put up a fight, I would have brought my 1,265 lb printer with me if I could.  Lucky for him, it wouldn&#39;t fit in the trunk ;). So... We are forced to enjoy the holidays sans work.  \r\n\r\nWe will be back December 30th and begin furiously working on your orders.  If you are in a time crunch, please note this on your order at checkout and we&#39;ll do our best to get your fabulous labels to you on time.\r\n\r\nWishing everyone a Merry Christmas and a safe holiday season!\r\n\r\nHappy Everything!\r\n\r\nRachel",
