        "description": "GARNY - iPhone 6 Plus -  LEATHER WALLET №75 -  WHISKEY COLOR\n\nHandcrafted from Whiskey color vegetable dyed cow hide. \nIt has 7 compartments:\n 1 on the right to hold your iPhone 6 Plus and on the left side 5 for credit cards, drivers license or business cards and under is a larger one to keep other documents or $ bills.  \nEdges are coated and polished. \n\nThe Whiskey, Chestnut Brown and Dark Brown colors will change color by time and will build  a darker rich patina.\n\nHand stitched with waxed nylon thread.\n\nAvailable other colors: Whiskey, Chestnut Brown, Black and Dark Brown\n\nPlease expect natural markings.\n\nFolded size: 6 7/8&quot; x 3 3/4&quot;  -  175mm x 95mm\n\nMade in U.S.A.\n\nThis item available for wholesale also.\nPlease convo me for dealer info.\n\nALL INTERNATIONAL ORDERS\n are shipped with First Class Mail from the Post Office. This service does have tracking number (not for all countries)  but no insurance. As our past experience with First Class Mail delivery is about 10-14 days  but a few times delivery time can be about 5 weeks.\nIf you need faster delivery and  insurance for your order then it has to be Express Mail, which will be extra charge. \n Customs or other fees , if any, at the receiver&#39;s side are not included in shipping.\n\nPlease let me know ahead if you like to have Express Mail Service.",
