        "title": "Custom Personalized Set of 2 Double Old Fashioned Glasses Whiskey Scotch Gift wedding favors groomsmen usher",
        "description": "This listing is for a set of two 14 ounce double old fashioned scotch whiskey rock glasses that can be personalized via sandblasting to your taste. I can put a name, a short piece of text, an initial or a monogram on these glasses using the font shown above. Each glass can be different as well. Just let me know in the &quot;notes to seller&quot; what you want if you order.\n\nI can also in some cases sandblast your design onto these as long as it is simple enough to cut as a sandblast stencil. Use the &quot;ask a question&quot; button and attach the image you want and I&#39;ll let you know if I can sandblast it or not.\n\nIf you want more than 4 glasses, please use the ask a question button with both the number of glasses you want and your zip code so I can give you a quote. Shipping on etsy&#39;s calculator is way off on this item for more than 4 glasses.\n\nPlease do note that 20 or more glasses have to be ordered at least 5 weeks ahead of the date you need them so I have time to make them AND the post office can deliver them to you.\n\nThe process I use is sandblasting, not paint or vinyl stickers...so these glasses are top-rack dishwasher safe as well as being permanent. The images shown are digitally generated and show approximately what text would look like on the glasses. These glasses are also made by hand, not by computerized laser engraving so please be aware there may be slight differences between each glass.\n\nThe last image show the glasses I obtain from the local restaurant supply store. They are unbranded generic double old fashioned glasses. Name brand glasses (i.e. Libby or Anchor Hocking) I can special order, but they are expensive and I will pass the costs along.\n\nUp to six glasses ships via USPS Priority mail to any US address, including APO/FPO, Alaska and Hawaii.",
