        "description": "This listing is for ONE or MORE flasks, personalized with any one of the above engraving designs.\n\nDesigned to carry liquor, our 6 oz. black, powder coated flasks are made of stainless steel. Our state-of-the-art laser engraves the coating resulting in a beautiful silver engraving, which shines in any light! The listing includes a silver stainless steel shot cup and a gift box.\n\nSPECIFICATIONS:\n3-1/2&quot; wide x 4&quot; tall\nHolds 6 ounces of liquor. \nFood grade stainless steel.\nSilver stainless steel cup holds 1 ounce of liquor.\n\nPERSONALIZATION:\nWe will laser-engrave the front side of each flask with your personalized information. Please see the engraving design/layout from the photos above and/or the drop-down menu.\n\nORDERING:\nSelect the quantity and design from the drop-down menus, click the green &#39;add to cart&#39; button, and specify all engraving information in the note box on the add to cart page, including the following information if applicable:\n1) Name;\n2) Title;\n3) Wedding date.\n\nMost orders are ready and shipped within 5 business days after receiving payment.\n\nINTERNATIONAL ORDERS are WELCOME!\n\nThank you for visiting our shop!\n* * * * * * * * * * * * * * * * * * * * * *",
