        "description": "Give a Personalized Maker&#39;s Mark Bottle Label to Anyone for any special occasion.\n\n****************************************************\n\nI currently only have the 750ml size. It Probably will not fit on any other size bottle.\n\nThis Listing is for the Labels only. (bottle not included)\n\nI also have Jack Daniel&#39;s, Jack Daniels Honey, and Patron options available. Please Ask for details if interested. \n\nLabels are Printed on Adhesive Paper, (No glue is required)\n\nCustomize the text on these labels like you want. Use your imagination and fill in each spot. I will take special care to get you exactly the label you want.\n\nSee Image for view of panels;\nThere are 3 panels A. B and C. Panel A can have a Picture if you like. \n\nNote: These Labels are made slightly larger than the original. They can be placed over the original or I would recommend removing the original Label first. They have straight edges (unlike the original jagged edges) \n\nTO ORDER:\n\nPlace the order and in the message tell me what you want in the following areas:\nPlease refer to the image for details and placement\n\nPanel A:  \nPick One\n   Small Picture & blurb\n   Name\n   Date\n   Large Picture\n\n\nPanel B: (Front)\n   1. \n   2. \n   3.\n   4. \n   6. \n   7.\n   8. \n\nPanel C: Name/Date/ Blurb\n\n\n\nFeel free to ask me any questions before you order.\n\nAfter you order, I will design your labels, send you a proof. After you OK the proof I will print and Ship.\n.............................................Pictures.........................................\n\nIf you want to add a picture, send me a photo and I will  make it black and white. Photos can not be in color. Attach the photo to a message in Etsy, or send it to Jon2jgcratives.com\n\n.............................................Fine Print.........................................\n\nPLEASE place your order before asking for a proof.\n\nPLEASE check your Etsy messages after ordering as I will contact you and send you a proof for approval.\n\n***If I don&#39;t get a response within 5 days of sending the initial proof I go will ahead and Print and Ship the item without it getting approved. So PLEASE respond to messages. Unless otherwise discussed. \n\n\nI no longer offer rushed orders. Orders Generally take a 1.5 - 2 weeks for creation and delivery once you place your order. They may take longer or shorter depending on delivery location and time it takes to get the proof OK&#39;ed. I will send a proof within 1-5 days of order. If you need the labels quickly, please consider the digital file (ask for details), or ask me to skip the proof process. (Be sure to tell me exactly what you want on the labels) I can also offer Express shipping for an additional charge. I can not be responsible for shipping delays.\n\n.............................................Shipping.........................................\n\nUS ORDERS:\nAll Orders Ship USPS First Class.\nYou can Upgrade your shipping to Priority (2-5 days, Not guaranteed by USPS) or Priority Express (1-2 days, guaranteed by USPS)\n\nOrders $50 or more Ship Priority for Free.  \n\nINTERNATIONAL ORDERS: are $10 extra shipping for First Class, and I can ship Priority for an additional fee. Message me for details. \n\n......................................................................................................\n\nFeel free to ask me any questions before you order.\n\nIf you need multiple Labels of the same design message me for a discount.\n\nThank you and have a wonderful day!",
