            "announcement": "The Dharma Notebook offers treasures found and treasures made.  We believe that each item tells a unique story and we endeavor to tell that story for each piece we offer. At The Dharma Notebook we celebrate the patina that each object has earned along its travels to our collection. It is our practice to freshen up found objects without removing the finish or covering up chips or dings. We think it gives them character! \r\n\r\n Please &quot;like&quot; The Dharma Notebook on Facebook and follow along with us on our adventures. Let us know if you are looking for anything - we&#39;ll keep an eye out for you. \r\n\r\nRetailer? Let&#39;s talk\r\n\r\nInterested in where some of these items come from? Check out our blog @ dharmanotebook.wordpress.com",
