        "description": "Personalized gifts are fun, meaningful and one of a kind! Sometimes finding the perfect gift for that special family member or close friend is a difficult endeavor. Magic Labels is here to help! Our labels make the best gifts for any occasion.\n \nWhether you are shopping for Father’s Day, Valentine’s Day, birthdays or anniversaries, our labels make a one of a kind gift! Our labels transform an ordinary bottle of liquor or wine into something extraordinary!\n \nThe possibilities are endless. We can print names, dates and short quotes. Our customers have ordered our labels for a variety of occasions. Our labels are the perfect groomsman and bridal gift for your special wedding party. Picture a row of liquor bottles, labeled with personalized names and your wedding date. What a unique wedding favor!\n \nFeatures:\n~Also available as a digital file if you need it as a rush order\n~We can print on almost any material, contact us for details about custom labels.\n~Available with color inks, white ink or even clear ink!\n~Labels are printing with state of the art equipment\n \nHOW TO PLACE AN ORDER:\n\nPlease include your information in the &quot;NOTE TO SELLER&quot; according to our template: (last image in this listing)\nPlease refer to the image for details and placement\n\n1. YOUR  TEXT 1\n2. YOUR  TEXT 2\n3. YOUR  TEXT 3\n4. YOUR  TEXT 4\n5.  &gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;\n\n.............................................Fine Print.........................................\n\nPLEASE place your order before asking for a proof.\n\nPLEASE check your Etsy messages after ordering as I will contact you and send you a proof for approval.\n\n***If I don&#39;t get a response within 5 days of sending the initial proof I will go ahead and Print and Ship the item without it getting approved. So PLEASE respond to messages. Unless otherwise discussed. \n\n.............................................Shipping.........................................\n\nOrders Generally take a 1 - 2 days for creation and a 4-8 business days for delivery.\nThey may take longer or shorter depending on delivery location.\nPlease be advised to make your orders at least 10-12 days before your event.\nIf you need the labels quickly, please consider the digital file (ask for details), \nI can also offer Express shipping for an additional charge $23\nhttps://www.etsy.com/ca/listing/218529028/express-post-service-with-tracking? \nI can not be responsible for lost items and shipping delays.\n......................................................................................................\n\nIf you need multiple Labels of the same design message me for a discount.\n\nThank you so much for looking at our personalized liquor labels! Contact us for any custom requests or questions! \n\nPlease be advised to make your orders at least 10-12 days before your event.",
